  \"2016-07-27T22:47:14.386602\",\n\t\"name\": \"narrative-report-medicine-lake-migratory-waterfowl-refuge-november-december-january-1938-3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Medicine Lake
  NWR outlines Refuge accomplishments from November, 1938 through January, 1939. The
  report begins by summarizing the weather conditions and water conditions during
  this period. Wildlife- including migratory birds, upland game birds, furbearers,
  predators, and rodents- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, and collections and receipts.
  Resource management is outlined; topics include grazing, sharecropping, and haying.
  The public relations section of the report describes recreational uses, Refuge visitors,
  hunting, fishing, and violations. Photographs are attached.\",\n\t\"license_title\":
